%spark

var disk_limit = 100 * 1000;

// Super ugly. The Probability array is a DenseVector, and basically none of the functions work on it. 
def convertProbArray (raw : DataFrame, table_name : String) : DataFrame = {
    // This is what wwe would like to do, but sometimes this won't work on cloud. Use hack. 
    if(!safe_mode) {
        println("Generating table using UDF.");
        // Unpack the probability vector to a more useful form.
        val toArr: Any => Array[Double] = _.asInstanceOf[DenseVector].toArray;

        // Generate udfs, so we can apply these to our data. 
        val toArrUdf = udf(toArr);
        return raw.withColumn("prob_array",toArrUdf($"probability"));
    }

    // OK, for whatever reason, the UDF isn't working. Let's just do this locally. 

    // Bring probabilities locally, compute the mapping, then send back to the grid. 
    var raw2 = raw.limit(disk_limit);
    var begin = System.currentTimeMillis();
    println("Starting collect.");
    var iter = asScalaIterator(raw2.select("probability").toLocalIterator()).map(r => (r(0).asInstanceOf[DenseVector].toArray));

    // We will go out on a limb and assume that the order doesn't change (should be true.)
    var tmp_df = sc.parallelize(iter.toSeq).toDF("prob_array");
    tmp_df = tmp_df.withColumn("rowId2", monotonically_increasing_id());


    println("Starting join: " + (System.currentTimeMillis() - begin));

    var keyed = raw2.withColumn("rowId", monotonically_increasing_id());
    var joined = keyed.join(tmp_df, keyed("rowId") === tmp_df("rowId2"));
    joined = joined.drop("rowId2");

    return joined;
};



def expandColumns (raw : DataFrame, table_name : String) : DataFrame = {
    var expanded = convertProbArray(raw, table_name);

    // Now split out the probabilities.
    expanded = expanded.withColumn("prob_p", $"prob_array"(0)).withColumn("prob_c", $"prob_array"(1)).withColumn("prob_3", $"prob_array"(2));
    expanded = expanded.withColumn("distEntropy", expr("-1.0 * ((prob_p*log(prob_p))  + (prob_c*log(prob_c)) + (prob_3*log(prob_3)))"));
    expanded = expanded.withColumn("rho", expr(" -1.0 * log(prob_array[next_status])"));


    if(!safe_mode) {
        expanded.registerTempTable(table_name);
        expanded.show(10);
    } else {
        // We bounce the table to disk only in safe mode. 
        println("Sending table to disk.");
        var begin = System.currentTimeMillis();

        // Send this all to disk and back to free up memory. 
        expanded.write.mode("overwrite").saveAsTable(table_name);
        expanded = spark.sql("SELECT * FROM " + table_name);

        println("Table materialized: " + (System.currentTimeMillis() - begin));  
    }

    return expanded;
};

def filterData (raw : DataFrame) : DataFrame = {
    var df_filtered = raw.filter($"MTM_LTV" > 0.0).filter($"MTM_LTV" < 2.0);
    df_filtered = df_filtered.filter($"INCENTIVE" > -1.0).filter($"CREDIT_SCORE" > 0);
    df_filtered = df_filtered.filter($"NEXT_STATUS" >= 0).filter($"NEXT_STATUS" <= 2);
    df_filtered = df_filtered.filter($"AGE" >= 0).filter($"STATUS" === 1);
    df_filtered = df_filtered.filter($"TERM" >= 0);
    df_filtered = df_filtered.filter($"MI_PERCENT" >= 0);
    df_filtered = df_filtered.filter($"UNIT_COUNT" >= 0);
    df_filtered = df_filtered.filter($"ORIG_LTV" >= 0);
    df_filtered = df_filtered.filter($"ORIG_CLTV" >= 0);
    df_filtered = df_filtered.filter($"ORIG_DTI" >= 0);
    df_filtered = df_filtered.filter($"ORIG_UPB" >= 0);
    df_filtered = df_filtered.filter($"ORIG_INTRATE" >= 0);

    // Go ahead and add the status columns here. 
    df_filtered = df_filtered.withColumn("actual_p", expr(" case when next_status = 0 then 1.0 else 0.0 end"));
    df_filtered = df_filtered.withColumn("actual_c", expr(" case when next_status = 1 then 1.0 else 0.0 end"));
    df_filtered = df_filtered.withColumn("actual_3", expr(" case when next_status = 2 then 1.0 else 0.0 end"));

    return df_filtered;
};


def centerColumn (exemplar : DataFrame, raw_data : DataFrame, column_name : String, column_renamed : String) : DataFrame = {
    val target_col = exemplar(column_name);
    val col_mean : Double = exemplar.select(avg(target_col)).collect()(0)(0).asInstanceOf[Double]
    var col_dev : Double = exemplar.select(stddev_pop(target_col)).collect()(0)(0).asInstanceOf[Double]

    if(col_dev <= 0.0) {
        col_dev = 1.0;
    }

    val output_col = raw_data(column_name);
    val output_data = raw_data.withColumn(column_renamed, (output_col - col_mean) / col_dev);

    return output_data;
}

def assembleCenteredFeatures (exemplar : DataFrame, raw_data : DataFrame, feature_cols : Array[String]) : DataFrame = {
    val remapped = feature_cols.map(a => a + "_normalized");

    var updated = raw_data;

    for(i <- 0 until feature_cols.size) {
       updated = centerColumn(exemplar, updated, feature_cols(i), remapped(i));
    }

    val assembler = new VectorAssembler().setInputCols(remapped).setOutputCol("features");
    updated = assembler.transform(updated);

    for(i <- 0 until feature_cols.size) {
      updated = updated.drop(remapped(i));
    }

    return updated;
}

%spark

